import React from 'react';
import './styles.css'

function Main() {
    return (
        <div class="centered">
            <h1> Welcome to Answerator </h1>
            <br /> <br />
            <input type="text"></input>
            <br />
            <button>Send Question</button>
            <br /> <br />
            <h3>The collaborative internal FAQs</h3>
        </div>
    )
}

export default Main;
